import React from 'react'

class Room extends React.Component{

    constructor(props){
        super(props)

        this.getNetworkStats = this.getNetworkStats.bind(this)
    }

    getNetworkStats(){
        console.log(getNetworkStats())
    }

    componentDidMount(){
        console.log("Here: " + this.props.location.state.url)
        var callFrame = window.DailyIframe.createFrame({showLeaveButton: true});
        callFrame.join({ url: this.props.location.state.url })
    }

    render(){
        return(
            <div>
                <button onClick={this.getNetworkStats}>Get Network Stats</button>
            </div>
        )
    }

}

export default Room
